var markers = L.markerClusterGroup();	
		for (var i = 0; i < temples.length; i++) {
			var temple = temples[i];
            var sect = temple.派别.replace(/"/g, '');
            var place = temple.场所名称.replace(/"/g, '');
            var address = temple.地址.replace(/"/g, '');
            var leader = temple.负责人姓名.replace(/"/g, '');
            var province = temple.省级行政区.replace(/"/g, '');
            var city = temple.地级行政区.replace(/"/g, '');
            var lon = temple.lon;
            var lat = temple.lat;
			var marker = L.marker(L.latLng(lat, lon), { 
                sect: sect,
                place: place,
                address: address,
                leader: leader,
                province: province,
                city: city
             });
            var popupContent = `<b>${place}</b><br>
                                <b>派别：</b>${sect}<br>
                                <b>地址：</b>${address}<br>
                                <b>负责人：</b>${leader}<br>
                                <b>所属省级行政区：</b>${province}<br>
                                <b>所属地级行政区：</b>${city}<br>`
			marker.bindPopup(popupContent);
			markers.addLayer(marker);
		}

markers.on('clusterclick', function (a) {
	a.layer.zoomToBounds();
});

map.addLayer(markers);

map.fitBounds(markers.getBounds())

