// 填充省份下拉列表
var provinceSelect = document.getElementById("provinceSelect");
for (var province in data) {
    var option = document.createElement("option");
    option.text = province;
    provinceSelect.add(option);
}

// 当省份下拉列表的选项改变时，更新城市下拉列表
provinceSelect.addEventListener("change", function(){
    // 清空城市下拉列表
    var citySelect = document.getElementById("citySelect");
    citySelect.length = 1; 

    // 填充城市下拉列表
    var cities = data[this.value];
    for (var city in cities) {
        var option = document.createElement("option");
        option.text = city;
        citySelect.add(option);
    }

    // 前往省会
    var capital = Object.keys(cities)[0];
    var latlon = cities[capital];
    map.setView(latlon, 7);

    map.dragging.disable();  // 禁用地图拖动

    // 1秒后启用地图拖动
    setTimeout(function(){
        map.dragging.enable();
    }, 1000);
});

// 当城市下拉列表的选项改变时，前往指定地点
citySelect.addEventListener("change", function(){
    var latlon = data[provinceSelect.value][this.value];
    map.setView(latlon, 13);
    map.dragging.disable();  // 禁用地图拖动

    // 1秒后启用地图拖动
    setTimeout(function(){
        map.dragging.enable();
    }, 1000);
});
